function profile(props){
    let {employee}=props;
return(
    <div className="profile">
       <img id="y" src={employee.profileImg} alt='profileImg'/>
       <p className='name'>{employee.name}</p>
       <h4>Location</h4>
       <p>{employee.location}</p>
       <h4>Blood group</h4>
       <p>{employee.bloodGroup}</p>
       <h4>Age</h4>
       <p>{employee.age}</p>
     </div>
)
}

export default profile;
